import {SET_NAME, SET_ROOM} from './types'

export const setName = (e) => dispatch => {
    dispatch({
        type: SET_NAME,
        payload: e.target.name.value
    })
}

export const setRoom = (e) => dispatch => {
    dispatch({
        type: SET_ROOM,
        payload: e.target.room_id.value
    })
}
